import React, { Component } from 'react'

import './style.css'

class index extends Component {
  constructor(props){
    super(props)
    this.state = {
      categoryName: '',
      itemsList: []
    };
  }

  componentDidMount(){
    const data = this.props.data;
    this.setState({
      categoryName: data.categories,
      itemsList: data.itemsList
    })
  }
    render() {
      console.log(this.state.itemsList)
        return (
            <div style={{ 
              display: 'flex',
              justifyContent: 'left',
              alignItems: 'center'
             }}>
            <div className="room-details">
            <div className="things">
              <h1>Furnitures</h1>
              <div className="items">
                <p>Item</p>
                <p>0</p>
              </div>
              <h3>Material</h3>
            </div>
          </div>

            </div>
        )
    }
}

export default index
